// src/components/MarketTrends.js
import React from 'react';
import ChartCard from './ChartCard';

const MarketTrends = () => {
  return (
    <div>
      <ChartCard title="Rental Macse">
        <p>Chart Placeholder</p>
      </ChartCard>
      <ChartCard title="Rental Market Trends">
        <p>Chart Placeholder</p>
      </ChartCard>
    </div>
  );
};

export default MarketTrends;
